import React, { useState, useEffect } from 'react';
import WebViewer3D from './WebViewer3D';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('https://webapi.partcommunity.com/service/table/vertical?apikey=e66120f9d9624823884cac1bf290ea88&language=german&eol=1&plm=true&includeunclassifiedbycountry=false&enablePreviewPerLine=true&path=bosch_rexroth_cytro/power_units/std_power_units/cytropac_asmtab.prj&includecrossref=true');
        const result = await response.json();
        setData(result);
      } catch (error) {
        console.error('Error fetching the data', error);
      }
    };

    fetchData();
  }, []);

  if (!data) {
    return <div>Loading...</div>;
  }
  const indexPath = data.index.line.values
  const cnsordernoName = indexPath.CNSORDERNO.desc;
  const cnsordernoValue = indexPath.CNSORDERNO.values[0].value;
  const mnName = indexPath.MN.desc;
  const mnValue = indexPath.MN.values[0].name;
  const typeName = indexPath.TYP.desc;
  const typeValue = indexPath.TYP.values[0].name;
  const csName = indexPath.CS.desc;
  const csValue = indexPath.CS.values[0].name;
  const tsName = indexPath.TS.desc;
  const tsValue = indexPath.TS.values[0].name;
  const drName = indexPath.DR.desc;
  const drValues = indexPath.DR.values.map(item => ({'name':item.name,'value':item.value}));
  const pcName = indexPath.PC.desc;
  const pcValues = indexPath.PC.values.map(item => item.name);
  const pmName = indexPath.PM.desc;
  const pmValues = indexPath.PM.values.map(item => item.name);
  const opName = indexPath.OP.desc;
  const opValue = indexPath.OP.values[0].name;
  const stName = indexPath.ST.desc;
  const stValues = indexPath.ST.values.map(item => item.name);
  const ctName = indexPath.CT.desc;
  const ctValues = indexPath.CT.values.map(item => item.name);
  const flName = indexPath.FL.desc;
  const flValue = indexPath.FL.values[0].name;
  const colName = indexPath.COL.desc;
  const colValue = indexPath.COL.values[0].name;
  const fdName = indexPath.FD.desc;
  const fdValues = indexPath.FD.values.map(item => item.name);
  console.log(drValues)
  return (
    <div>
      <p>{cnsordernoName}: {cnsordernoValue}</p>
      <p>{mnName}: {mnValue}</p>
      <p>{typeName}: {typeValue}</p>
      <p>{csName}: {csValue}</p>
      <p>Tank size: {tsValue}</p>
      <form>
      <label>Drive:</label>
      <select>
      {drValues.map((item, index) => (
            <option key={index} value={item.value}>{item.name}</option>
          ))}
      </select>
      </form>
      <br></br>
      <form>
      <label>Performance Class:</label>
      <select>
      {pcValues.map((value, index) => (
              <option key={index}>{value}</option>
            ))}
      </select>
      </form>
      <br></br>
      <form>
      <label>Pump Design:</label>
      <select>
      {pmValues.map((value, index) => (
              <option key={index}>{value}</option>
            ))}
      </select>
      </form>
      <p>Operating Pressure: {opValue}</p>
      <form>
      <label>Sensor Technology:</label>
      <select>
      {stValues.map((value, index) => (
              <option key={index}>{value}</option>
            ))}
      </select>
      </form>
      <br></br>
      <form>
      <label>Cooling type / maximum cooling power fluid:</label>
      <select>
      {ctValues.map((value, index) => (
              <option key={index}>{value}</option>
            ))}
      </select>
      </form>
      <p>Filling: {flValue}</p>
      <p>Coloring: {colValue}</p>
      <form>
      <label>Further Details:</label>
      <select>
      {fdValues.map((value, index) => (
              <option key={index}>{value}</option>
            ))}
      </select>
      </form>
      <h1>WebViewer3D Demo</h1>
            <WebViewer3D />
    </div>

  );
}

export default App;
